export function getCreated (appState) {
    return appState.formReducer.created
}

export function getStatus (appState) {
    return appState.formReducer.status
}

export function getCName (appState) {
    return appState.formReducer.cName
}

export function getOrderId (appState) {
    return appState.formReducer.orderId
}

export function getIsExpandedForm (appState) {
    return appState.formReducer.isExpandedForm
}
